import React from 'react';
import './FeatureCards.css';

const FeatureCards = () => {
  const features = [
    {
      icon: 'fa-truck',
      title: 'Envío Gratis',
      description: 'En todos los pedidos superiores a $50'
    },
    {
      icon: 'fa-shield-alt',
      title: 'Garantía de Calidad',
      description: 'Satisfacción garantizada en todos nuestros productos'
    },
    {
      icon: 'fa-exchange-alt',
      title: 'Devoluciones Sencillas',
      description: 'Proceso de devolución sin complicaciones durante 30 días'
    },
    {
      icon: 'fa-headset',
      title: 'Soporte 24/7',
      description: 'Atención al cliente disponible en todo momento'
    }
  ];

  return (
    <div className="feature-cards">
      <div className="container">
        <div className="feature-cards-container">
          {features.map((feature, index) => (
            <div key={index} className="feature-card">
              <div className="feature-icon">
                <i className={`fas ${feature.icon}`}></i>
              </div>
              <h3 className="feature-title">{feature.title}</h3>
              <p className="feature-description">{feature.description}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default FeatureCards;
